// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

interface IVotingToken {
    function setActiveVotingId(uint votingId) external;
}

contract EVoting is ReentrancyGuard {
    struct Candidate {
        uint id;
        string name;
        string photoUrl;
        string resume;
        string vision;
        string mission;
        uint voteCount;
    }

    struct Voting {
        uint id;
        string title;
        mapping(uint => Candidate) candidates;
        uint candidatesCount;
        uint votingStart;
        uint votingEnd;
        uint registrationEnd;
        mapping(address => bool) voters;
        mapping(address => bool) hasVoted;
        mapping(address => bytes32) voterEmailHashes;
        mapping(address => bool) isRegistered;
        bool exists;
        uint totalVotes;
        uint winningCandidateId;
        uint winningVoteCount;
    }

    struct VotingDetails {
        uint id;
        string title;
        uint votingStart;
        uint votingEnd;
        uint registrationEnd;
        uint candidatesCount;
        uint totalVotes;
    }

    struct Winner {
        uint votingId;
        string votingTitle;
        uint winnerId;
        string winnerName;
        uint voteCount;
        string photoUrl;
    }

    mapping(uint => Voting) public votings;
    uint public votingCount;
    IERC20 public votingToken;
    IVotingToken public votingTokenContract;
    address public admin;

    event VotingCreated(uint indexed votingId, string title, uint startTime, uint endTime, uint registrationEnd);
    event CandidateAdded(uint indexed votingId, uint indexed candidateId, string name, string photoUrl, string resume, string vision, string mission);
    event CandidatesInitialized(uint indexed votingId, uint candidatesCount);
    event VoterRegistered(uint indexed votingId, address indexed voter, bytes32 emailHash);
    event Voted(uint indexed votingId, address indexed voter, uint indexed candidateId);
    event VotingTimeSet(uint indexed votingId, uint startTime, uint endTime, uint registrationEnd);
    event ContractDeployed(address indexed admin, address indexed votingToken);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Hanya admin yang dapat melakukan tindakan ini.");
        _;
    }

    modifier onlyDuringVoting(uint _votingId) {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");
        require(block.timestamp >= voting.votingStart && block.timestamp <= voting.votingEnd, "Voting tidak aktif.");
        _;
    }

    constructor(IERC20 _votingToken) {
        admin = msg.sender;
        votingToken = _votingToken;
        votingTokenContract = IVotingToken(address(_votingToken));
        emit ContractDeployed(msg.sender, address(_votingToken));
    }

    function createVoting(
        string memory _title,
        string[] memory _candidateNames,
        string[] memory _photoUrls,
        string[] memory _resumes,
        string[] memory _visions,
        string[] memory _missions,
        uint _votingStart,
        uint _votingEnd,
        uint _registrationEnd
    ) public onlyAdmin {
        require(_votingEnd > _votingStart, "Waktu selesai harus setelah waktu mulai.");
        require(_registrationEnd <= _votingStart, "Waktu registrasi harus sebelum atau sama dengan waktu mulai voting.");
        require(_candidateNames.length == _photoUrls.length &&
                _candidateNames.length == _resumes.length &&
                _candidateNames.length == _visions.length &&
                _candidateNames.length == _missions.length, "Array data kandidat harus memiliki panjang yang sama.");
        require(_candidateNames.length > 0, "Minimal satu kandidat diperlukan.");

        votingCount++;
        Voting storage newVoting = votings[votingCount];
        newVoting.id = votingCount;
        newVoting.title = _title;
        newVoting.votingStart = _votingStart;
        newVoting.votingEnd = _votingEnd;
        newVoting.registrationEnd = _registrationEnd;
        newVoting.exists = true;
        newVoting.totalVotes = 0;
        newVoting.winningCandidateId = 0;
        newVoting.winningVoteCount = 0;

        for (uint i = 0; i < _candidateNames.length; i++) {
            newVoting.candidatesCount++;
            newVoting.candidates[newVoting.candidatesCount] = Candidate(
                newVoting.candidatesCount,
                _candidateNames[i],
                _photoUrls[i],
                _resumes[i],
                _visions[i],
                _missions[i],
                0
            );
            emit CandidateAdded(votingCount, newVoting.candidatesCount, _candidateNames[i], _photoUrls[i], _resumes[i], _visions[i], _missions[i]);
        }

        emit CandidatesInitialized(votingCount, newVoting.candidatesCount);
        emit VotingCreated(votingCount, _title, _votingStart, _votingEnd, _registrationEnd);
        emit VotingTimeSet(votingCount, _votingStart, _votingEnd, _registrationEnd);

        votingTokenContract.setActiveVotingId(votingCount);
    }

    function getAllVotingDetails() public view returns (VotingDetails[] memory) {
        VotingDetails[] memory allDetails = new VotingDetails[](votingCount);
        for (uint i = 1; i <= votingCount; i++) {
            Voting storage voting = votings[i];
            if (voting.exists) {
                allDetails[i-1] = VotingDetails({
                    id: voting.id,
                    title: voting.title,
                    votingStart: voting.votingStart,
                    votingEnd: voting.votingEnd,
                    registrationEnd: voting.registrationEnd,
                    candidatesCount: voting.candidatesCount,
                    totalVotes: voting.totalVotes
                });
            }
        }
        return allDetails;
    }

    // Fungsi baru untuk mendapatkan votingEnd dari votingId tertentu
    function getVotingEnd(uint _votingId) public view returns (uint) {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");
        return voting.votingEnd;
    }

    function selfRegister(uint _votingId, bytes32 _emailHash) public {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");
        require(block.timestamp <= voting.registrationEnd, "Registrasi telah ditutup.");
        require(!voting.isRegistered[msg.sender], "Anda sudah terdaftar.");
        require(_emailHash != bytes32(0), "Hash email tidak boleh kosong.");

        voting.isRegistered[msg.sender] = true;
        voting.voterEmailHashes[msg.sender] = _emailHash;
        voting.voters[msg.sender] = true;
        emit VoterRegistered(_votingId, msg.sender, _emailHash);
    }

    function vote(uint _votingId, uint _candidateId) public onlyDuringVoting(_votingId) nonReentrant {
        Voting storage voting = votings[_votingId];
        require(voting.voters[msg.sender], "Anda bukan pemilih terdaftar.");
        require(!voting.hasVoted[msg.sender], "Anda sudah memilih.");
        require(_candidateId > 0 && _candidateId <= voting.candidatesCount, "ID kandidat tidak valid.");
        require(votingToken.allowance(msg.sender, address(this)) >= 1 * 10 ** 18, "Allowance tidak cukup untuk voting.");

        votingToken.transferFrom(msg.sender, address(votingToken), 1 * 10 ** 18);

        voting.hasVoted[msg.sender] = true;
        voting.candidates[_candidateId].voteCount++;
        voting.totalVotes++;

        if (voting.candidates[_candidateId].voteCount > voting.winningVoteCount) {
            voting.winningVoteCount = voting.candidates[_candidateId].voteCount;
            voting.winningCandidateId = _candidateId;
        }

        emit Voted(_votingId, msg.sender, _candidateId);
    }

    function getCandidate(uint _votingId, uint _candidateId) public view returns (uint, string memory, string memory, string memory, string memory, string memory, uint) {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");
        require(_candidateId > 0 && _candidateId <= voting.candidatesCount, "ID kandidat tidak valid.");
        Candidate memory candidate = voting.candidates[_candidateId];

        uint displayedVoteCount = block.timestamp > voting.votingEnd ? candidate.voteCount : 0;

        return (candidate.id, candidate.name, candidate.photoUrl, candidate.resume, candidate.vision, candidate.mission, displayedVoteCount);
    }

    function getAllCandidates(uint _votingId) public view returns (Candidate[] memory) {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");
        Candidate[] memory candidates = new Candidate[](voting.candidatesCount);
        for (uint i = 1; i <= voting.candidatesCount; i++) {
            candidates[i-1] = voting.candidates[i];
            candidates[i-1].voteCount = block.timestamp > voting.votingEnd ? candidates[i-1].voteCount : 0;
        }
        return candidates;
    }

    function getWinner(uint _votingId) public view returns (uint, string memory, uint, string memory) {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");
        require(block.timestamp > voting.votingEnd, "Voting masih berlangsung.");

        return (
            voting.winningCandidateId,
            voting.candidates[voting.winningCandidateId].name,
            voting.winningVoteCount,
            voting.candidates[voting.winningCandidateId].photoUrl
        );
    }

    // Fungsi baru untuk mendapatkan semua pemenang dari voting yang sudah selesai
    function getAllWinners() public view returns (Winner[] memory) {
        // Hitung jumlah voting yang sudah selesai dan memiliki pemenang
        uint finishedCount = 0;
        for (uint i = 1; i <= votingCount; i++) {
            Voting storage voting = votings[i];
            if (voting.exists && block.timestamp > voting.votingEnd && voting.winningCandidateId != 0) {
                finishedCount++;
            }
        }

        // Buat array untuk menyimpan pemenang
        Winner[] memory winners = new Winner[](finishedCount);
        uint index = 0;

        // Isi array dengan data pemenang
        for (uint i = 1; i <= votingCount; i++) {
            Voting storage voting = votings[i];
            if (voting.exists && block.timestamp > voting.votingEnd && voting.winningCandidateId != 0) {
                winners[index] = Winner({
                    votingId: voting.id,
                    votingTitle: voting.title,
                    winnerId: voting.winningCandidateId,
                    winnerName: voting.candidates[voting.winningCandidateId].name,
                    voteCount: voting.winningVoteCount,
                    photoUrl: voting.candidates[voting.winningCandidateId].photoUrl
                });
                index++;
            }
        }

        return winners;
    }

    function getVotingDetails(uint _votingId) public view returns (string memory title, uint startTime, uint endTime, uint registrationEnd, uint candidateCount, uint totalVotes) {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");

        return (voting.title, voting.votingStart, voting.votingEnd, voting.registrationEnd, voting.candidatesCount, voting.totalVotes);
    }

    function isVoterRegistered(uint _votingId, address _voter) public view returns (bool) {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");
        return voting.voters[_voter];
    }

    function hasVoterVoted(uint _votingId, address _voter) public view returns (bool) {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");
        return voting.hasVoted[_voter];
    }

    function getVoterEmailHash(uint _votingId, address _voter) public view returns (bytes32) {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");
        return voting.voterEmailHashes[_voter];
    }

    function isRegistered(uint _votingId, address _voter) public view returns (bool) {
        Voting storage voting = votings[_votingId];
        require(voting.exists, "Voting tidak ada.");
        return voting.isRegistered[_voter];
    }
}
